import { react } from "@babel/types";
import "../App.css";
import Fetchingdata from "./Fetchingdata";
import SellerForm from "./SellerForm"
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
          <Route path="/sellerForm">
          <SellerForm/>
          </Route>
          <Route path="/">
          <Fetchingdata/>
          </Route>
        </Switch>
      </Router>
  );
}

export default App;
